const mongoose = require('mongoose');

const MealSchema = mongoose.Schema({
  calories: {
    type: String
  },
  fat: {
    type: String
  },
  date: {
    type: Date,
    default: Date.now
  },
  user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'users'
  }
});

export default mongoose.model('meal', MealSchema);
